	add("serein", "{\"term\":\"serein\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027serein\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Light rainfall from a cloudless sky after sunset\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Raphael Confiant, \u0027Mamzelle Dragonfly\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;She must have caught a chill from the \u0027\u0027serein\u0027\u0027, that\u0027s all!\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("serendipity", "{\"term\":\"serendipity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|Serendip|t1\u003dvariant of \u0027Serendib\u0027: Ceylon, Sri Lanka|ity|lang\u003den}}. Coined by {{w|Horace Walpole}} in 1754 based on the Persian story of {{w|The Three Princes of Serendip}}, who (Walpole wrote to a friend) were “always making discoveries, by accidents and sagacity, of things which they were not in quest of”.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unsought, unintended, and/or unexpected, but fortunate, discovery and/or learning experience that happens by accident\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A combination of events which are not individually beneficial, but occurring together to produce a good or wonderful outcome\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Serendipity\u0027\u0027 is when you find things you weren\u0027t looking for because finding what you \u0027are\u0027 looking for is so damn difficult\u0027. – w:Erin Erin McKean, [http://www.ted.com/index.php/talks/view/id/161 speech at TED\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The most random \u0027\u0027serendipity\u0027\u0027 brought the two of us together, and now, we are happily married! If I was just 15 seconds slower, I\u0027d have never met her!\u0027 - \u0027\u00271754\u0027\u0027 Horace Walpole, \u0027The Letters of Horace Walpole\u0027, vol. 2, Letter 90, To Sir Horace Mann, Arlington Street, Jan. 28, 1754.\u0026lt;ref\u0026gt;[http://www.gutenberg.org/ebooks/4610 The Project Gutenberg Etext of The Letters of Horace Walpole, Volume 2]\u0026lt;/ref\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This discovery, indeed, is almost of that kind which I call \u0027\u0027Serendipity\u0027\u0027, a very expressive word, which, as I have nothing better to tell you, I shall endeavour to explain to you: you will understand it better by the derivation than by the definition. I once read a silly fairy tale, called \u0026quot;The Three Princes of Serendip;\u0026quot; as their Highnesses travelled, they were always making discoveries, by accidents and sagacity, of things which they were not in quest of: for instance, one of them discovered that a mule blind of the right eye had travelled the same road lately, because the grass was eaten only on the left side, where it was worse than on the right – now do you understand \u0027\u0027Serendipity\u0027\u0027? One of the most remarkable instances of this accidental Sagacity, (for you must observe that no discovery of a thing you are looking for comes under this description,) was of my Lord Shaftsbury, who, happening to dine at Lord Chancellor Clarendon\u0027s, found out the marriage of the Duke of York and Mrs. Hyde, by the respect with which her mother treated her at table\", \"priority\":5}]}, \"synonyms\":{}}");

