	add("serenity", "{\"term\":\"serenity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027sérénité\u0027 from Latin \u0027serenitas\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being serene; calmness; peacefulness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A lack of agitation or disturbance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A title given to a reigning prince or similar dignitary\", \"priority\":3}]}, \"synonyms\":{}}");

