	add("sergeant", "{\"term\":\"sergeant\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027sergeant\u0027 \u0027sergeaunt\u0027 \u0027serjent\u0027 \u0027serjaunt\u0027 \u0027serjawnt\u0027 \u0027sergant\u0027 from Old french (842-ca. 1400) \u0027sergeant\u0027 \u0027sergent\u0027 \u0027serjant\u0027 \u0027sergient\u0027 \u0027sergant\u0027 (sergeant, servant) from \u0027servientem\u0027 accusative of \u0027serviens\u0027 (a servant, vassal, soldier, apparitor) from Latin \u0027serviēns\u0027 (serving) present participle of \u0027serviō\u0027 (serve, be a slave to) More at {{l|en|servant}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"UK army rank with NATO code OR-6, senior to corporal and junior to warrant officer ranks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The highest rank of noncommissioned officer in some non-naval military forces and police\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A lawyer of the highest rank, equivalent to the doctor of civil law\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"sergeant\u0027\u0027 surgeon, i.e. a servant, or attendant, surgeon\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A fish, the cobia\", \"priority\":5}]}, \"synonyms\":{}}");

	add("serir", "{\"term\":\"serir\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A desert of pebbles or larger stones\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1909\u0027\u0027, Royal Geographical Society (Great Britain), \u0027The Geographical Journal\u0027, page 256\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Immediately south of Tejerri, the most southern village of the Gatrun oasis, the sandy desert disappears, and great \u0027\u0027serirs\u0027\u0027, large fields covered by fine gravel, slowly lead up into a succession of broad valleys and ridges of an unsurpassed wildness\", \"priority\":3}]}, \"synonyms\":{}}");

	add("seriation", "{\"term\":\"seriation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|seriate|ion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the arrangement of things in a serie\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the relative dating of archaeological artifacts in a chronological order\", \"priority\":2}]}, \"synonyms\":{}}");

	add("series", "{\"term\":\"series\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027lang\u003dla\u0027 from \u0027lang\u003dla|serere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A number of things that follow on one after the other or are connected one after the other\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d19|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dWhen Timothy and Julia hurried up the staircase to the bedroom floor, where a considerable commotion was taking place, Tim took Barry Leach with him.\u0026amp;nbsp;[\u0026amp;hellip;]. The captive made no resistance and came not only quietly but in a \u0027\u0027series\u0027\u0027 of eager little rushes like a timid dog on a choke chain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d3|page\u003d21|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/joris-luyendijk-banking-blog/2013/jun/19/banking-britain-beyond-control Our banks are out of passage\u003dSeeing the British establishment struggle with the financial sector is like watching an alcoholic\u0026amp;nbsp;[\u0026amp;hellip;].\u0026amp;nbsp; Until 2008 there was denial over what finance had become. When a \u0027\u0027series\u0027\u0027 of bank failures made this impossible, there was widespread anger, leading to the public humiliation of symbolic figures\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A television or radio program which consists of several episodes that are broadcast in regular interval\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Friends\u0027 was one of the most successful television \u0027\u0027series\u0027\u0027 in recent years.\u0027\u0026lt;!--note that the italicisation is correct here--\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A group of episodes of a television or radio program broadcast in regular intervals with a long break between each group, usually with one year between the beginning of each\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The sum of the terms of a sequence. \u0026lt;!-- ?????? --\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A group of matches between two sides, with the aim being to win more matches than the opposition\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An unranked taxon\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A subdivision of a genus, a taxonomic rank below that of section (and subsection) but above that of species\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A parcel of rough diamonds of assorted qualities\", \"priority\":11}]}, \"synonyms\":{}}");

