	add("sermon", "{\"term\":\"sermon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman {{m|fro|sermun}}, Old french (842-ca. 1400) {{m|fro|sermon}}, from Latin {{m|la|sermō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Religious discourse; a written or spoken address on a religious or moral matter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dOne saint\u0027s day in mid-term a certain newly appointed suffragan-bishop came to the school chapel, and there preached on “The Inner Life.”\u0026amp;nbsp; He at once secured attention by his informal method, and when presently the coughing of Jarvis […] interrupted the \u0027\u0027sermon\u0027\u0027, he altogether captivated his audience with a remark about cough lozenges being cheap and easily procurable\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A lengthy speech of reproval\", \"priority\":3}]}, \"synonyms\":{}}");

