	add("serow", "{\"term\":\"serow\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"lepcha\"], \"text\":\"From Lepcha {{m|lep|||tr\u003dsă-ro|long-haired Tibetan goat}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several species of Asian ungulates of the genus \u0027Capricornis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Jan Dodd, Simon Richmond, \u0027The Rough Guide to Japan\u0027, [http://books.google.com.au/books?id\u003d-iaiARtuCaIC\u0026amp;pg\u003dPA265\u0026amp;dq\u003d%22serow%22%7C%22serows%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dXzP1Ud2SBYTDkQXLnYHABg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22serow%22%7C%22serows%22\u0026amp;f\u003dfalse page 265\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The peninsula is home to an estimated four hundred macaques, the world\u0027s most northerly colony of wild monkeys, and a growing population of red-haired, goat-like \u0027\u0027serow\u0027\u0027, both of which are a protected species\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Maurice Burton, Robert Burton, \u0027International Wildlife Encyclopedia\u0027, [http://books.google.com.au/books?id\u003d_YicMQmIA7wC\u0026amp;pg\u003dPA2323\u0026amp;dq\u003d%22serow%22%7C%22serows%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dXzP1Ud2SBYTDkQXLnYHABg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22serow%22%7C%22serows%22\u0026amp;f\u003dfalse page 2323\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027serow\u0027\u0027 differs in being larger, at least 32 inches (81 cm) tall, whereas gorals are never more than 28 inches (71 cm). \u0027\u0027Serows\u0027\u0027 are also distinguished in having small face glands that give out a duikerlike odor\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, John P. Rafferty (editor), \u0027Grazers\u0027, [http://books.google.com.au/books?id\u003dCprehwrfLlAC\u0026amp;pg\u003dPA147\u0026amp;dq\u003d%22serow%22%7C%22serows%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dXzP1Ud2SBYTDkQXLnYHABg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22serow%22%7C%22serows%22\u0026amp;f\u003dfalse page 147\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Where official protection is accorded, it is usually on paper only, as the \u0027\u0027serow\u0027\u0027 is hunted for meat and its body parts, which are used in local medicine. (For example, it is believed that the broth obtained by boiling a \u0027\u0027serow\u0027\u0027 head is a remedy for arthritis\", \"priority\":10}]}, \"synonyms\":{}}");

