	add("serolin", "{\"term\":\"serolin\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"\u0027serum\u0027 and Latin \u0027oleum|lang\u003dla\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fatty substance found in the blood, probably a mixture of fats, cholesterin, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A body found in faeces and thought to be formed in the intestines from the cholesterin of the bile\", \"priority\":2}]}, \"synonyms\":{}}");

