	add("serotonin", "{\"term\":\"serotonin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027sero-\u0027 + \u0027tonic\u0027 + \u0027-in\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An indoleamine neurotransmitter, 5-hydroxytryptamine, that is involved in depression, appetite, etc., and is crucial in maintaining a sense of well-being, security, etc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("serpens", "{\"term\":\"serpens\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003dmul}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large summer constellation of the northern sky said to resemble a snake. It is the only constellation consisting of two parts (Serpens Caput and Serpens Cauda) separated by the constellation Ophiuchus, representing the snake handler Asclepius\", \"priority\":1}]}, \"synonyms\":{}}");

	add("serpent", "{\"term\":\"serpent\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|fro|serpent||snake, serpent|lang\u003den}}, from Latin {{m|la|serpēns||snake}}, from the verb {{m|la|serpō||I creep, crawl}}, from Proto-indo-european {{m|ine-pro|*serp-}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A snake\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An obsolete wind instrument in the brass family, whose shape is suggestive of a snake (w:Serpent Wikipedia article\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A subtle, treacherous, malicious person\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A kind of firework with a serpentine motion\", \"priority\":4}]}, \"synonyms\":{}}");

	add("serpentinite", "{\"term\":\"serpentinite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|serpentine|ite|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a metamorphic rock composed of serpentine minerals formed by the hydration of ultramafic rocks\", \"priority\":1}]}, \"synonyms\":{}}");

	add("serpentwood", "{\"term\":\"serpentwood\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The tree \u0027w:Rauwolfia Rauwolfia serpentina\u0027 or its extracts, an important ingredient in Indian traditional medicine\", \"priority\":1}]}, \"synonyms\":{}}");

	add("serpukhovian", "{\"term\":\"serpukhovian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A subdivision of the Carboniferous period\", \"priority\":1}]}, \"synonyms\":{}}");

	add("serravallian", "{\"term\":\"serravallian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A subdivision of the Miocene epoch\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sertularian", "{\"term\":\"sertularian\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From {{taxlink|Sertularella|genus|noshow\u003d1}}, a former genus name, {{suffix||an|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any species of genus , or of family \u0027\u0027, hydroids having branched chitinous stems and simple sessile hydrothecae\", \"priority\":1}]}, \"synonyms\":{}}");

	add("serum", "{\"term\":\"serum\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027serum\u0027 (whey) Cognates: French \u0027sérum\u0027 Spanish \u0027suero\u0027 Italian \u0027siere\u0027 \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The clear yellowish fluid obtained upon separating whole blood into its solid and liquid components after it has been allowed to clot. Also called blood serum\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Blood serum from the tissues of immunized animals, containing antibodies and used to transfer immunity to another individual, called antiserum\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A watery fluid from animal tissue, especially one that moistens the surface of serous membranes or that is exuded by such membranes when they become inflamed, such as in edema or a blister\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The watery portion of certain animal fluids, as blood, milk, etc; whey\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An intensive moisturising product to be applied after cleansing but before a general moisturiser\", \"priority\":5}]}, \"synonyms\":{}}");

	add("serve", "{\"term\":\"serve\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"etruscan\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) {{m|enm|serven}}, from Middle french (ca. 1400-1600) {{m|frm|servir}}, from Old french (842-ca. 1400) from Latin {{m|la|serviō||be a slave; serve}}, from Latin {{m|la|servus||slave; servant}}, which perhaps derives from Etruscan (compare Etruscan proper names {{m|ett|𐌔𐌄𐌓𐌅𐌉|tr\u003dServi}}, {{m|ett|𐌔𐌄𐌓𐌅𐌄|tr\u003dServe}}).\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act of putting the ball or shuttlecock in play in various games\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Whose \u0027\u0027serve\u0027\u0027 is it\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1961\u0027\u0027 January 13, Marshall Smith, \u0027From Waif to a Winner, the Clown of the Courts\u0027, \u0027w:Life Life\u0027, [http://books.google.com.au/books?id\u003dzUUEAAAAMBAJ\u0026amp;pg\u003dPA99\u0026amp;lpg\u003dPA99\u0026amp;dq\u003d%22serve+of%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dfsbT0i6jmW\u0026amp;sig\u003divo-i47owp-XdJgbxCzEpo3udXk\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003doKxAUJGoFfGdiAfE8oDACA\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22serve%20of%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 99\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He had no power \u0027\u0027serve\u0027\u0027 of his own, no backhand, no volley, no lob, no idea of pace or tactics\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Steve Boga, \u0027Badminton\u0027, [http://books.google.com.au/books?id\u003dbP9CXl9yfswC\u0026amp;pg\u003dPR8\u0026amp;lpg\u003dPR8\u0026amp;dq\u003d%22serve+of%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d2LfCFu10xU\u0026amp;sig\u003daooRI5hyhJYG93-riXqoEgBuvyg\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9YdAUMy3I6mUiAfV0IDgBw\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22serve%20of%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page viii\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The first \u0027\u0027serve\u0027\u0027 of the game is from the right half court to the half diagonally opposite\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Mihnea Moldoveanu, Roger L. Martin, \u0027Diaminds: Decoding the Mental Habits of Successful Thinkers\u0027, [http://books.google.com.au/books?id\u003dG3wrwl4GjlsC\u0026amp;pg\u003dPA21\u0026amp;lpg\u003dPA21\u0026amp;dq\u003d%22serve+of%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dlLkJFyzRDG\u0026amp;sig\u003d3OnuUGON25cENQTgvElruZixYWo\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9YdAUMy3I6mUiAfV0IDgBw\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22serve%20of%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 31\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Against a \u0027\u0027serve\u0027\u0027 of the calibre of McEnroe′s, an opponent will try to anticipate the ball′s direction and lean either to the left or to the right, depending on where he feels the server will go\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A portion of food or drink, a serving\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Susanna Holt, \u0027Fitness Food: The Essential Guide to Eating Well and Performing Better\u0027, Murdoch Books Australia, [http://books.google.com.au/books?id\u003dzNk_GJ9a774C\u0026amp;pg\u003dPA23\u0026amp;lpg\u003dPA23\u0026amp;dq\u003d%22serve+of%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d-1VNx7bLEI\u0026amp;sig\u003dRhjmjKju4jVr8TsxDcYvUAbHOIY\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9YdAUMy3I6mUiAfV0IDgBw\u0026amp;redir_esc\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22serve%20of%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 23\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The night before your event, base your evening meal on high-carbohydrate foods with a small \u0027\u0027serve\u0027\u0027 of lean protein\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Verity Campbell, \u0027Turkey\u0027, Lonely Planet, [http://books.google.com.au/books?id\u003dwOghYEov0YEC\u0026amp;pg\u003dPA142\u0026amp;lpg\u003dPA142\u0026amp;dq\u003d%22serve+of%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dPBBlQ0Y08C\u0026amp;sig\u003dUoKUPhjLPiyEvs-XTtjXkRnAnp4\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9YdAUMy3I6mUiAfV0IDgBw\u0026amp;redir_esc\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22serve%20of%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 142\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Come here for a cappuccino that could hold its own on Via Veneto in Rome (€2) and a \u0027\u0027serve\u0027\u0027 of their crunchy fresh cheese \u0027börek\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Michael E. Cichorski, \u0027Maximum Asthma Control: The Revolutionary 3-Step Anti Asthma Program\u0027, [http://books.google.com.au/books?id\u003dBj0-lexAbCgC\u0026amp;pg\u003dPA100\u0026amp;lpg\u003dPA100\u0026amp;dq\u003d%22serve+of%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dMctQPz9w4r\u0026amp;sig\u003dFIwiLfNnMjBEndWCZpc6NRAl7Us\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9YdAUMy3I6mUiAfV0IDgBw\u0026amp;redir_esc\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22serve%20of%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 100\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Reintroduce protein; add a small \u0027\u0027serve\u0027\u0027 of salmon, tuna or sardines every second day (tinned variety or fresh\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Great Britain Parliament House of Commons Health Committee, \u0027Alcohol: First Report of Session 2009-10\u0027, Volume 2, [http://books.google.com.au/books?id\u003dI33KjooP6M8C\u0026amp;pg\u003dPA189\u0026amp;lpg\u003dPA189\u0026amp;dq\u003d%22serve+of%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dlrxIF_CwXq\u0026amp;sig\u003d-xGUVJj078E9BIAB6LooSmagBXQ\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9YdAUMy3I6mUiAfV0IDgBw\u0026amp;redir_esc\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22serve%20of%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 189\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Smirnoff Appleback was a finished drink, comprising a 50ml \u0027\u0027serve\u0027\u0027 of Smirnoff, with ice and lemonade or ginger ale and equating to 1.9 units\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Lesley Campbell, Alan L. Rubin, \u0027Type 2 Diabetes For Dummies\u0027, Australian Edition, [http://books.google.com.au/books?id\u003dYTffKvXAry4C\u0026amp;pg\u003dPA117\u0026amp;lpg\u003dPA117\u0026amp;dq\u003d%22serve+of%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dNJZHUBXeH1\u0026amp;sig\u003dZqOGq8EOzGY_GIPhG5E_Abw3ZZg\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9YdAUMy3I6mUiAfV0IDgBw\u0026amp;redir_esc\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22serve%20of%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 117\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"One \u0027\u0027serve\u0027\u0027 of carbohydrates is approximately equal to a slice of bread, a piece of fruit, third of a cup of cooked rice, half a cup of grains, cereals, starchy vegetables or cooked pasta, 200 grams of plain yoghurt, or 300 millilitres of milk\", \"priority\":27}]}, \"synonyms\":{}}");

	add("serval", "{\"term\":\"serval\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"French\", \"Latin\", \"Portuguese\"], \"text\":\"From French \u0027serval\u0027 from Portuguese \u0027cerval\u0027 (iberian lynx) from Latin \u0027lupus\u0027 (wolf) \u0027cervarius\u0027 (pertaining to a stag) (wolf that hunts the stag), \u0027cervus\u0027 (deer, stag)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A medium-sized African wild cat, formerly \u0027Felis serval\", \"priority\":1}]}, \"synonyms\":{}}");

	add("servant", "{\"term\":\"servant\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027servant\u0027 from the present participle of the verb \u0027servir\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is hired to perform regular household or other duties, and receives compensation. As opposed to a slave\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"As a political system democracy seems to me extraordinarily foolish, but I would not go out of my way to protest against it. My \u0027\u0027servant\u0027\u0027 is, so far as I am concerned, welcome to as many votes as he can get. I would very gladly make mine over to him if I could\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One who serves another, providing help in some manner\", \"priority\":3}]}, \"synonyms\":{}}");

	add("server", "{\"term\":\"server\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|serve|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who serves; a waitress or waiter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A tray for dishes; a salver\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A program which provides services to other programs or users, either in the same computer or over a computer network\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A computer dedicated to running such programs\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d1|page\u003d18|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/2013/jun/07/obama-apple-google-facebook-tainted-prism Obama\u0027s once hip brand is now passage\u003dNow we are liberal with our innermost secrets, spraying them into the public ether with a generosity our forebears could not have imagined. Where we once sent love letters in a sealed envelope, or stuck photographs of our children in a family album, now such private material is despatched to \u0027\u0027servers\u0027\u0027 and clouds operated by people we don\u0027t know and will never meet\", \"priority\":5}]}, \"synonyms\":{}}");

	add("serviceableness", "{\"term\":\"serviceableness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|serviceable|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the state or condition of being serviceable\", \"priority\":1}]}, \"synonyms\":{}}");

	add("serviceberry", "{\"term\":\"serviceberry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|service|berry|gloss1\u003dan alteration of \u0027Sorbus\u0027, a genus with a similar berry|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any plant of the genus \u0027Amelanchier\u0027 of small deciduous trees and large shrubs in the family Rosaceae\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The berry of such a plant\", \"priority\":2}]}, \"synonyms\":{}}");

	add("serviceman", "{\"term\":\"serviceman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|service|man|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man who serves in the armed forces\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person, especially a man, employed in service and maintenance of equipment\", \"priority\":2}]}, \"synonyms\":{}}");

	add("servicemember", "{\"term\":\"servicemember\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|service|member|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A serviceman or servicewoman\", \"priority\":1}]}, \"synonyms\":{}}");

	add("services", "{\"term\":\"services\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which is produced, then traded, bought or sold, then finally consumed and consists of an action or work\", \"priority\":1}]}, \"synonyms\":{}}");

	add("servicescape", "{\"term\":\"servicescape\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|service|scape|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The range of services available in the market\", \"priority\":1}]}, \"synonyms\":{}}");

	add("servicewoman", "{\"term\":\"servicewoman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|service|woman|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woman who serves in the armed forces\", \"priority\":1}]}, \"synonyms\":{}}");

	add("serviette", "{\"term\":\"serviette\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027serviette\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A table napkin, now especially a paper one\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1887\u0027\u0027, “A Member of the Aristocracy”, \u0027Manners and Rules of Good Society; Or Solecisms to Be Avoided\u0027, 1999 facsimile edition, Angus\u0026amp;Robertson, %22serviettes%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dVLa_KG7_ir\u0026amp;sig\u003d5TGtHLkkGnrHKiee7jAyORD4t-E\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dvrlAUI6sNsWriAfTyoHACQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22serviettes%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 116\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"She should unfold her \u0027\u0027serviette\u0027\u0027 and place it on her lap. It is immaterial whether she places the bread on the right or left-hand side of the cover when taking it from the \u0027\u0027serviette\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A gentleman should do the same with his \u0027\u0027serviette\u0027\u0027 and bread, placing the one across his knees, and the other at his right or left hand\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1914\u0027\u0027, w:Arnold Arnold Bennett, \u0027The Price of Love\u0027, 2005, Echo Library, %22serviettes%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dtGoIuYIVAD\u0026amp;sig\u003dy7ts5viRO6IBAdmlyvcv8pUHanc\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dvrlAUI6sNsWriAfTyoHACQ\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"%22serviettes%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 40\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"And then, when the meal finally did begin Mrs. Maldon′s \u0027\u0027serviette\u0027\u0027 and silver \u0027\u0027serviette\u0027\u0027-ring had vanished\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1955\u0027\u0027 October 25, \u0027The Official Gazette of the Colony and Protectorate of Kenya\u0027, %22serviettes%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dKOXZhnqwhW\u0026amp;sig\u003dqlfvZ32zbPEHQJuRbfEEj0CXuqc\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dvrlAUI6sNsWriAfTyoHACQ\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"%22serviettes%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 1145\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Nature of goods\u0027.—Toilet paper, paper handkerchiefs, paper towels, paper \u0027\u0027serviettes\u0027\u0027 and paper covers for lavatory seats, none being medicated\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Tracey Dalton, \u0027The Food and Beverage Handbook\u0027, Orchard Publishing, South Africa, %22serviettes%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dnw2HIejaGN\u0026amp;sig\u003de8NWv50EVA3PW5I_X2_7HIKcuB4\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dvrlAUI6sNsWriAfTyoHACQ\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"%22serviettes%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 36\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"There is a wide variety of \u0027\u0027serviette\u0027\u0027 folds, but \u0027\u0027serviettes\u0027\u0027 themselves have two basic functions\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"• To provide the guest with a means of wiping his/her hands and mouth, an\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"• To make the restaurant look attractive\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, K.E. Silva, \u0027A Simple Distance\u0027, Akashic Books, US, %22serviettes%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d5eYc7_x_5d\u0026amp;sig\u003dsKcfr3Iz4jKWiUpGXO3bj2_ixzw\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dwspAUK7VMNGPiAfltoCQDw\u0026amp;redir_esc\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"%22serviettes%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 90\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"I told them to put the paper \u0027\u0027serviettes\u0027\u0027 out on the table, and look, they′ve put out the cloth napkins! Here, take these back to the kitchen and bring me the stack of paper \u0027\u0027serviettes\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Sarina Singh, \u0027South India\u0027, Lonely Planet, %22serviettes%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d-XHV3gMwO6\u0026amp;sig\u003dADdiHEoQGL6pWZYGlpHt1jK6NQc\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dt89AUOrqB4eeiAfImYDgBA\u0026amp;redir_esc\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"%22serviettes%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 83\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Avoid the temptation to lick your fingers – a finger bowl filled with warm water is usually placed on the table to wash your fingers at the end of the meal and \u0027\u0027serviettes\u0027\u0027 should be on hand to dry them\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"a lazy Susan\", \"priority\":23}]}, \"synonyms\":{}}");

